import React, { FC, useState } from 'react'
import { v4 } from 'uuid'
import { INode } from '../../types'

const Tree: FC = () => {
  const [nodes, setNodes] = useState<Array<INode>>([
    {
      id: v4(),
      name: 'mcc-tomsk.de',
      children: [],
    },
  ])

  return <div></div>
}

export default Tree
